import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <div className="app_header">
        <img
          className="app_headerImage"
          src="Instagram-Logo.png"
          alt=""
        />
      </div>
    </div>
  );
}

export default App;
